    is the submission point for all data collected using funds from the Geothermal Technology
    Office of the U.S. Department of Energy.  It was established to receive, manage
    and make available all geothermal-relevant data generated from projects funded by
    the DOE Geothermal Technologies Office. This includes data from GTO-funded projects
    associated with any portion of the geothermal project life-cycle (exploration, development,
